import './App.css';

function Main(){
    const nav = {news:'Новости', home: 'Главная'}
    return (
        <>
            <ul>
                <li>{nav.news}</li>
                <li>{nav.home}</li>
                <li>{nav.news}</li>
                <li>{nav.news}</li>
                <li>{nav.news}</li>
            </ul>
        </>
    );
}

export default Main
